    let condition = false;
    if (value === test) {
        condition = true;
    }
    return condition;
}
export const food = [
    'White Rice',
    'Fried Rice',
    'Jollof Rice', 
    'Mixed Rice',
    'Porridge Beans',
    'Bread 350',
    'Bread 500'

]
